import logo from './logo.svg';
import './App.css';
import Navbar from './components/NavBar/Navbar';
import { Switch, Route } from 'antd';


function App() {
  return (
    <div className="App">
      <header >
        <Navbar />
      </header>
      <body className="container">
        <Switch>
        <Route path="/home" component={Homepage} exact/>
        <Route path="/notelist" component={NoteList} exact/>
        <Route path="/note/:id" component={NoteItem} exact></Route>
        <Route path="/statistics" component={Statistics} exact></Route>
        </Switch>
      </body>
      <footer>
        Designed by @Tenomareen
      </footer>
    </div>
  );
}

export default App;
